import { Mod } from "../models/Mod";
import { Modes } from "../models/Modes";

interface DebutProps {
    debuts: string[];
    restart: () => void;
    mod: Mod;
}


const DebutsPlay: FC<DebutProps> = ({debuts, restart, mod}) => {

    const makes = (debut: string) => {
        mod.mod = Modes.PLAY
        //console.log({debut})
        restart()
      }

      if(mod.mod === Modes.PLAY) {
        return (
            <p className = "debuts">
                <h3>{title}</h3>
                {debuts.map(debut => 
                //{(mod.debut === debut) ? () : ()}
                    <p key={1}>
                        <button>{debut}</button>
                    </p>
                )}
            </p>
        );
      }

    return (
        <p className = "debuts">
            {debuts.map(debut => 
                <p key={1}>
                    <button onClick={() => makes(debut)}>{debut}</button>
                </p>
            )}
        </p>
    );
};


export default DebutsPlay;
